export const style = `
      .navbar {
        padding-top: 10px;
        background: #333;
      }
      ul {

        color: #fff;
        display: flex;
        list-style: none;
      }

      ul li {
        font-size: 18px;
        margin-right: 20px;
      }

      ul li a {
        color: #fff;
        text-decoration: none;`
